import React from "react";
import "./css/FrequentQuestions.css";
import { questionaire } from "../Data";
import { IoIosArrowUp } from "react-icons/io";

const FrequentQuestions = () => {
  const response = document.querySelector(".response__container");
  const response2 = document.querySelector(".response__container2");
  const arrow__up = document.querySelector(".arrow_up_io");
  const showResponse = (id) => {
    response.classList.toggle("showText");
    response2.classList.toggle("showText");
    arrow__up.classList.toggle("active");
  };
  return (
    <div className="frequent__container">
      <div className="question__container">
        <h1>Any Question?</h1>
      </div>
      <div className="queries__container">
        <div className="questionaire__container">
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Molestias,
          soluta?
          <IoIosArrowUp className="arrow_up_io" onClick={showResponse} />
          <div className="response__container">
            Lorem ipsum dolor sit, amet consectetur adipisicing elit.
            Consequuntur facilis eos blanditiis ad dolorum ipsa magni
            praesentium a inventore est!
          </div>
        </div>
      </div>
    </div>
  );
};

export default FrequentQuestions;
